import { Form } from 'antd'
import React from 'react'
import styled from 'styled-components'
import ImageFileInput from './ImageFileInput'

const MyPic = styled.div`
  margin-left: auto;
  margin-right: auto;
  width: 250px;
  height: 250px;
  border-radius: 50%;
  border: solid;
  overflow: hidden;
  position: relative;
`

function ProfileForm({ imageUploader }) {
  const [file2, setFile2] = useState({ fileName: null, fileURL: null })

  return (
    <div>
      <Form>
        <Form.Item>
          <MyPic>
            <ImageFileInput imageUploader={imageUploader} file={file2 !== null && file2} />
          </MyPic>
        </Form.Item>
      </Form>
    </div>
  )
}

export default ProfileForm
